function request(url, body) {
  return fetch(
    'https://back-q-doctor.herokuapp.com'+url,
    {
      method: 'POST',
      body: JSON.stringify(body),
      headers: {'Content-Type': 'application/json'},
    },
  );
}


const registrationUser = (omsNumber, birthDate) => request('/people', {omsNumber, birthDate});

export { registrationUser };
